import React from 'react';
import TextLoop from "react-text-loop";
import { css } from 'emotion'


import maname from '../maname.png'


const symbol = "<"

const Maname = () => {
    return (
        <div>
            <div>
                <h1> {symbol} PATRICIA SHIRAZI /></h1>
                {/* <img className={styles.maname} src={maname} /> */}
            </div>
            <h2 className={styles.text}>
                <TextLoop springConfig={{ stiffness: 180, damping: 8}}>
                    <span> Software Engineering </span>
                    <span> Mathematics </span>
                    <span> Entrepreneurship </span>
                    <span> User Experience </span>
                </TextLoop>
            </h2>
        </div>
    )
}
export default Maname;

const styles = {
    maname: css`
    width: 40%;
    height: 60%;
    margin-right: 40%;
    margin-top: 10%;
    `,
    text: css`
    margin-right: 40%;
    color: green;
    `,
}
